contract NormalProxy is Ownable {
    using SafeMath for uint256;
    
    uint256 constant public TOKEN_PRECISION = 1e12;
    
    Token public token;
     
    constructor(address tokenAddress) public { 
        token = Token(tokenAddress);
    } 

    function transferProxy(
      address[] memory addressProps,
      uint256[] memory _passProxyProps) 
      public payable returns (address[] memory returnAddress, uint256[] memory returnProxyPros, uint256 longOfReturn) {
        
        uint256 fromValueProxyUpdated = _passProxyProps[0].sub(_passProxyProps[3]);
        
        uint256 sendValue = _passProxyProps[3];
        
        uint256 toValueProxyUpdated = _passProxyProps[1].add(sendValue);
        
        uint256 valueOfThatContract = token.balanceOf(address(this));
        
        address[] memory _returnProxyAddressPros = new address[](4);
        
        // changed hierarchy fix sending value to contracts
        _returnProxyAddressPros[0] = addressProps[2];
        _returnProxyAddressPros[1] = address(this);
        _returnProxyAddressPros[2] = addressProps[0];
        _returnProxyAddressPros[3] = addressProps[1];
        
        uint valueCount = 6;
        uint256[] memory _returnProxyPros = new uint256[](valueCount);

        // changed hierarchy fix sending value to contracts
        _returnProxyPros[0] = _passProxyProps[2];
        _returnProxyPros[1] = valueOfThatContract;
        _returnProxyPros[2] = fromValueProxyUpdated;
        _returnProxyPros[3] = toValueProxyUpdated;
        
        _returnProxyPros[4] = _passProxyProps[3];
        _returnProxyPros[5] = _passProxyProps[4];
         
        return (_returnProxyAddressPros, _returnProxyPros, valueCount);
    }
    
    
    function returnFromContractTokens() public onlyOwner returns (bool success) {
	  token.transfer(msg.sender, token.balanceOf(address(this)));
	  return true;
    }
 
}
